    <script>

        function lazyLine(selector){
            let paths = $(`${selector} path`);
            paths.each(function (index, node) {
            $(this).css('stroke-dasharray', node.getTotalLength())
                .css('stroke-dashoffset', node.getTotalLength())
                .fadeIn();
            $(this).css('animation-delay', `${set_delay(paths, index / 2) / 2}s`)
        })
        function set_delay(paths, index) {
            return Math.abs(((paths.length - 1 - paths.length / 4) - index) - index) + .2
        }
        }
        lazyLine('#svg_container');
